import React from "react";
import './sub-component css/Projects_content.css';
import aio from '../../assets/images/aio.jpg';

function Projects_content() {
    return(
        <>
            <div className="projects-content-body">
                
                <div className="projects-content-box1">
                    <img src={aio} alt="aio image" />
                </div>
                <div className="projects-content-box2">
                    <div className="content-box1">
                        
                    </div>
                    <div className="content-box2"></div>
                    <div className="content-box3"></div>
                </div>
            </div>
        </>
    );
}
export default Projects_content;
